import React from "react";


function MtgCard({cards}){
    return (
    <div className="">
      <div key={cards.id} className="ui card eight wide column card">
        <img key={cards.id} src={cards.imageUrl} alt="404"/>
      </div>
    </div>
    )
}

export default MtgCard;
